import React from "react";


class TextInput extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            email: ""
        }
    }

    render(){
        return(
            <input 
                type="text" 
                name="text_input"
                value={this.state.email} 
                onChange={e => this.setState({email: e.target.value})}
            />
        );
    }
}


export default TextInput;
